import React from "react";
import "./styles.scss";
import strings from "../../en-NZ";
import ContentBlock from "../../components/ContentBlock/ContentBlock";

const content = [
  strings.about.iam,
  strings.about.recent,
  strings.about.self,
  strings.about.check,
];

const AboutSection = () => {
  return (
    <div className="about">
      <ContentBlock
        id="about-content"
        subtitle={strings.about.title}
        content={content}
      />
    </div>
  );
};

export default AboutSection;
